import React from 'react';
import { AppBar, Button } from '@mui/material/';
import { Link } from "react-router-dom";


function Header(){
    return (
        <div>  
        {/* # THE HEADER BAR */}
        <AppBar>

          <div className="header">
            <h1 className="leftPadding">Fast Meals</h1>
            <div className="links rightPadding">
            <Link className="link" to="/">
              <Button color="inherit"><h3>Add Meals</h3></Button>
            </Link>
            <Link className="link" to="/meals">
            <Button className="link" color="inherit"><h3>View Meals</h3></Button>
            </Link>
            </div>
          </div>

      </AppBar>

      </div>
    )
}

export default Header;
